    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - + col2 * - 64 * - col0 + - col2 IN ( + ( col1 ) + - 9 + - 73 );
  - name: tab1

outputs:
  - name: q3500.out
    data: |
      51	14	96
      85	5	59
      91	47	68
